import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class SignUp extends Component {
  constructor(props) {
    super(props)
    // BINDING GOES HERE
  }

  render() {
    return(
      <div className='sign-up'>
        <h2> Sign Up </h2>
        <Link to='/signup'>
          Sign Up
        </Link>
      </div>
    )
  }
}

export default SignUp;
